import React, { Component } from 'react';
class NavBar extends Component{

    render(){
        return(
            <React.Fragment>
            <div>
                <p id='neon-logo' style= "font-family: Pacifico !important;">PhiNet</p>
            </div>
        </React.Fragment>
        )
    }

};

export default NavBar;
